import { BrowserRouter, Route, Routes } from "react-router-dom";
import "./App.css";
import Header from "./layout/Header";
import Home from "./component/Home";

const App = () => {
  return (
    <BrowserRouter className="App">
      <Header />
      <Routes>
        <Route path="/" element={<Home/>}/>
        <Route path="/restaurant/:id" />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
